import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
/* mdb-react-ui-kit */
import 'mdb-react-ui-kit/dist/css/mdb.min.css';
import "@fortawesome/fontawesome-free/css/all.min.css";
import { MDBInputGroup, MDBInput, MDBIcon, MDBBtn } from 'mdb-react-ui-kit';
import { MDBCol, MDBRow } from 'mdb-react-ui-kit';
import {
  MDBNavbar,
  MDBContainer,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBDropdown,
  MDBDropdownMenu,
  MDBDropdownToggle,
  MDBDropdownItem,
} from 'mdb-react-ui-kit';

import { MDBBadge } from 'mdb-react-ui-kit';

import SidebarMenu from 'react-bootstrap-sidebar-menu';

function App() {
    const [showShow, setShowShow] = useState(false);

  const toggleShow = () => setShowShow(!showShow);
  return (
  <div className='d-inline-flex position-relative'>
    <MDBBtn tag='a' onClick={toggleShow} style = {{ display:!showShow ? 'block' : 'none' }}>
    <img
      className='rounded-4 shadow-4'
      src='https://mdbootstrap.com/img/Photos/Avatars/man2.jpg'
      alt='Avatar'
      style={{ width: '50px', height: '50px' }}
    />
    </MDBBtn>
    <div className = "SideBar">
        <MDBCollapse show={showShow}>
                <popup />
              <MDBIcon fas icon='shopping-cart' onClick = {toggleShow}/>
        </MDBCollapse>
    </div>
  </div>
  );
}
function popup(){
return(
<nav className="menu">
   <input type="checkbox" href="#" className="menu-open" name="menu-open" id="menu-open" />
   <label className="menu-open-button" for="menu-open">
    <span className="lines line-1"></span>
    <span className="lines line-2"></span>
    <span className="lines line-3"></span>
  </label>

   <a href="#" className="menu-item blue"> <i class="fa fa-anchor"></i> </a>
   <a href="#" className="menu-item green"> <i class="fa fa-coffee"></i> </a>
